import React from "react";



function Project(props) {
    return (
        <section>
            {props.prevProjects.map(item => {
                if(item.hasApp === true)
                {
                    return(
                    <div key={item.id}>
                        <h3>{item.name}</h3>
                        <img src={item.photoLink} width="400px"/>
                        <a href= {item.gitHub}>
                            <img alt="GitHub Logo" src= "https://cdn-icons-png.flaticon.com/512/25/25231.png" width="32px" height="32px"/>
                        </a>
                        <a href= {item.appLink}>
                            <img alt="GitHub Logo" src= "https://assets.stickpng.com/images/588a6ad0d06f6719692a2d29.png" width="32px" height="32px"/>
                        </a>
                        <p>{item.description}</p>
                    </div>
                    )
                }else{
                }
            })}
        </section>
    )
}

export default Project;
